import React from 'react'
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <>
      <footer className='footer mt-5 mx-2 mb-1'>
        <h1 className="text-primary">Nitin_Patil</h1>
        <Link to="">Github</Link>
        <Link to="">LinkedIN</Link>
        <Link to="">Instagram</Link>
      </footer>
    </>
  )
}

export default Footer;
